import React, { Component } from "react";
import {
    MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavItem, MDBNavLink, MDBNavbarToggler, MDBCollapse, MDBDropdown,
    MDBDropdownToggle, MDBDropdownMenu, MDBDropdownItem, MDBIcon, MDBBtn, MDBCol, MDBFormInline, MDBContainer
} from "mdbreact";
import { BrowserRouter as Router, Link } from 'react-router-dom';
import logo from '../../assets/images/common/logo_quickfood.png';

class HeaderAfterLogin extends Component {
    state = {
        isOpen: false
    };

    toggleCollapse = () => {
        this.setState({ isOpen: !this.state.isOpen });
    }

    render() {
        return (
            <Router>
                <MDBNavbar light expand="lg" className="pt-0 pb-0 px-5">
                    <MDBContainer></MDBContainer>
                </MDBNavbar>
            </Router>
        );
    }
}

export default HeaderAfterLogin;
